    false,nt"url": null,nt"notes": "The Oregon Department of Geology and Mineral
    Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
    topographic LiDAR data for multiple areas within the State of Oregon. The areas
    for LiDAR collection have been designed as part of a collaborative effort of state,
    federal, and local agencies in order to meet a wide range of project goals. This
    LiDAR data set was collected from October 29 through November 4, 2010 and encompasses
    areas including and surrounding Eagle Point, Oregon and along the Rogue River in
    Jackson County. This data set consists of bare earth and unclassified points. The
    average pulse density is 8.08 pulses per square meter over terrestrial surfaces.
    The area of interest (AOI) totals 203 square miles (129,628 acres) and the total
    area flown (TAF) covers 211 square miles (134,899 acres). The TAF acreage is greater
    than the original AOI acreage due to buffering and flight planning optimization.
    This metadata record reflects all the data and cumulative statistics for the overall
    lidar survey. In some areas of heavy vegetation or forest cover, there may be relatively
    few ground points in the LiDAR data. Elevation values for open water surfaces are
    not valid elevation values because few LiDAR points are returned from water surfaces.
    LiDAR intensity values were also collected.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
